import { useContext, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

import MyHeader from './../components/MyHeader';
import MyButton from './../components/MyButton';
import LoginInputBox from './../components/LoginInputBox'
import LoginButton from './../components/LoginButton'

const MyPage = () => {
    const navigate = useNavigate();
    return (
        <div>
            <MyHeader
                headText={"내 정보"}
                leftChild={
                    <MyButton text={"< 뒤로가기"} onClick={() => navigate(-1)} />
                }
                rightChild={
                    <MyButton text={"변경하기"} onClick={() => navigate(-1)} type={"negative"}/>
                }
            />
            <div className="mypage_wrap">
                <div className="mypage_box">
                    <div className="mypage_left">
                        <h3 className="mypage_title">아이디</h3>
                        <div className="mypage_content"></div>
                    </div>
                    <div className="mypage_right"></div>
                </div>
                <div className="mypage_box">
                    <div className="mypage_left">
                        <h3 className="mypage_title">아이디</h3>
                        <input className="mypage_content" />
                    </div>
                    <div className="mypage_right"></div>
                </div>
            </div>
        </div>
    );
};

export default MyPage;
